import openai as openaifrom configs import OPENAI_KEYopenai.api_key = OPENAI_KEYasync def send_analyzed_report(report: str) -> str:    completion = openai.chat.completions.create(        model="gpt-3.5-turbo",        messages=[            {"role": "system",             "content": "Забудь про всі попередні повідомлення. Ти асистен "                        "який вміє якісно аналізувати інформацію та складати "                        "по цій інформації гарний розписаний звіт, також "                        "залишай посилання на фото в тексті звіту, "                        "якщо такі є."},            {"role": "user", "content": f"{report}"}        ]    )    return completion.choices[0].message.content